DROP TABLE IF EXISTS indicadores_oee;
DROP TABLE IF EXISTS operadores;
DROP TABLE IF EXISTS maquinas;

CREATE TABLE operadores (
  id_operador INT PRIMARY KEY,
  nome VARCHAR(50),
  matricula VARCHAR(50)
);

CREATE TABLE maquinas (
  id_maquina INT PRIMARY KEY,
  nome_maquina VARCHAR(50),
  data_fabricacao DATE,
  ultima_manutencao DATE
);

CREATE TABLE indicadores_oee (
  id INT AUTO_INCREMENT PRIMARY KEY,
  data_hora DATETIME,
  id_maquina INT,
  id_operador INT,
  tempo_planejado_producao INT,
  tempo_parada_nao_planejada INT,
  tempo_operacao_real INT,
  tempo_ciclo_ideal FLOAT,
  tempo_ciclo_real FLOAT,
  quantidade_total_produzida INT,
  quantidade_unidades_boas INT,
  quantidade_refugos INT,
  disponibilidade FLOAT,
  desempenho FLOAT,
  qualidade FLOAT,
  oee FLOAT,
  FOREIGN KEY (id_maquina) REFERENCES maquinas(id_maquina),
  FOREIGN KEY (id_operador) REFERENCES operadores(id_operador)
);

